insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (1, 'Garek', 'Slamaker', 'gslamaker0@gnu.org', 'Vancouver', 'BC', 'Tagalog', null, 'Psychologist', 'https://images.unsplash.com/photo-1525134479668-1bee5c7c6845?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=687&q=80', 'I offer individual, couples, and family counseling based on a holistic, integrative, and meaning-centered approach.', null);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (2, 'Nealy', 'Ivashinnikov', 'nivashinnikov1@parallels.com', 'Richmond', 'BC', 'Mandarin', null, 'Counsellor', 'https://images.unsplash.com/photo-1507003211169-0a1dd7228f2d?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8NHx8cmFuZG9tJTIwcGVyc29ufGVufDB8fDB8fA%3D%3D&auto=format&fit=crop&w=800&q=60', 'Within the therapeutic relationship, I draw from multiple modalities and theories that support a relational and person-centered environment backed by neurosciences and somatic awareness.', 88);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (3, 'Ole', 'Beagley', 'obeagley2@ovh.net', 'Victoria', 'BC', 'Punjabi', null, 'Counsellor', 'https://images.unsplash.com/photo-1619194617062-5a61b9c6a049?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8Mjl8fHJhbmRvbSUyMHBlcnNvbnxlbnwwfHwwfHw%3D&auto=format&fit=crop&w=800&q=60', 'I welcome, respect, and believe in ALL people, regardless of marginalization or elevation.', 117);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (4, 'Xever', 'Patel', 'xpatel3@ow.ly', 'Vancouver', 'BC', 'Italian', 'Japanese', 'Clinical Social Worker', 'https://images.unsplash.com/photo-1552058544-f2b08422138a?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8NXx8cGVyc29ufGVufDB8fDB8fA%3D%3D&auto=format&fit=crop&w=800&q=60', 'I have devoted my practice to working holistically with people who wish to free themselves from the grips of trauma and return to states of safety, flow, and empowerment.', 68);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (5, 'Tobias', 'Brainsby', 'tbrainsby4@census.gov', 'Kelowna', 'BC', 'Swahili', 'Japanese', 'Psychiatrist', 'https://images.unsplash.com/photo-1531427186611-ecfd6d936c79?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MTh8fHBlcnNvbnxlbnwwfHwwfHw%3D&auto=format&fit=crop&w=800&q=60', 'I am a Registered Psychologist who specializes in therapy for children, adolescents, and adults in Vancouver, BC. I provide evidence-based treatment for clients with a range of difficulties.', 104);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (6, 'Glenn', 'Paschek', 'gpaschek5@wordpress.org', 'Kelowna', 'BC', 'German', 'Japanese', 'Counsellor', 'https://images.unsplash.com/photo-1580489944761-15a19d654956?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MTd8fHBlcnNvbnxlbnwwfHwwfHw%3D&auto=format&fit=crop&w=800&q=60', 'I will guide you to learn techniques to nurture your curiosity and well being. You will develop the awareness necessary to observe the unique way that you relate to the world.', 90);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (7, 'Hesther', 'Chaperling', 'hchaperling6@vistaprint.com', 'Burnaby', 'BC', 'German', null, 'Counsellor', 'https://images.unsplash.com/photo-1500648767791-00dcc994a43e?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8Mjd8fHBlcnNvbnxlbnwwfHwwfHw%3D&auto=format&fit=crop&w=800&q=60', 'Together we can investigate thought patterns, get in touch with unexpressed emotions, heal childhood wounds, clear repetitive patterns of life that prevent you from living as you want.', 140);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (8, 'Minerva', 'Tressler', 'mtressler7@reverbnation.com', 'Burnaby', 'BC', 'Japanese', null, 'Clinical Social Worker', 'https://images.unsplash.com/photo-1554727242-741c14fa561c?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MzJ8fHBlcnNvbnxlbnwwfHwwfHw%3D&auto=format&fit=crop&w=800&q=60', 'I help you develop your emotional intelligence to learn to forgive, release fears, overcome pain, propose new purposes, and connect with everything that gives you security, harmony and well-being to achieve what you set out to do.', 134);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (9, 'Mortimer', 'Luter', 'mluter8@amazon.com', 'Vancouver', 'BC', 'Mandarin','Japanese' , 'Counsellor', 'https://images.unsplash.com/photo-1567532939604-b6b5b0db2604?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MzB8fHBlcnNvbnxlbnwwfHwwfHw%3D&auto=format&fit=crop&w=800&q=60', 'Making changes in your life is not always easy. I provide a safe space for you to explore and discover what motivates you.', null);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (10, 'Eva', 'Teal', 'eteal9@indiegogo.com', 'Abbotsford', 'BC', 'Japanese', 'Vietnamese', 'Clinical Social Worker', 'https://images.unsplash.com/photo-1611432579699-484f7990b127?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MXx8aGVhZHNob3R8ZW58MHx8MHx8&auto=format&fit=crop&w=1200&q=60', 'Seeking help with blocks in life is normal, although it can be hard. You do not have to suffer alone.', 56);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (11, 'Marni', 'Cromly', 'mcromlya@miibeian.gov.cn', 'Abbotsford', 'BC', 'Vietnamese', 'Japanese', 'Psychiatrist', 'https://images.unsplash.com/photo-1633332755192-727a05c4013d?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8Mnx8aGVhZHNob3R8ZW58MHx8MHx8&auto=format&fit=crop&w=1200&q=60', 'Conflicts. Heartache. Angst. Chronic worry. Fear. Prolonged Sadness. Anger. You probably tried to deal with your struggles on your own, but you are not meant to suffer alone. Most of us reach out for help to family and friends. But sometimes you need more. You need someone who knows how to help you through your difficulties. You need someone who will hear, understand and help you find your way out of darkness. You need someone who can help you develop the courage to say no to toxic choices and yes to life-affirming decisions.', 61);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (12, 'Rachel', 'Twidle', 'rtwidleb@artisteer.com', 'Abbotsford', 'BC', 'Mandarin', 'Japanese', 'Psychologist', 'https://images.unsplash.com/photo-1627161683077-e34782c24d81?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8M3x8aGVhZHNob3R8ZW58MHx8MHx8&auto=format&fit=crop&w=1200&q=60', 'I am a Registered Psychologist in British Columbia with over 15 years of experience in psychology. In addition to my private practice, I most recently held the position of Inpatient Psychologist at Vancouver General Hospital. Working at the Segal Family Health Centre in VGH has allowed me to cultivate my skills in identifying differential diagnoses by way of administering and interpreting psychological assessments for the inpatient units.', null);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (13, 'Papageno', 'Titterell', 'ptitterellc@typepad.com', 'Burnaby', 'BC', 'Cantonese', 'Japanese', 'Psychiatrist', 'https://images.unsplash.com/photo-1595211877493-41a4e5f236b3?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8NHx8aGVhZHNob3R8ZW58MHx8MHx8&auto=format&fit=crop&w=1200&q=60', 'Feel like you are crumbling on the inside, trying to hold it all together with work, your family, and/or in your relationship meanwhile you feel tense or just "off". Have you worked hard, “done the right thing,” and followed what you thought was the right path but still feel burned out, unsure, and overwhelmed? Do you believe you should feel happier – be happier – with your life but instead you feel stuck, empty, or anxious? If “is this it?” is a question you have been asking yourself often, then I want you to know: you’re not alone', 95);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (14, 'Bartolomeo', 'Halifax', 'bhalifaxd@joomla.org', 'Burnaby', 'BC', 'Japanese', null, 'Clinical Social Worker', 'https://images.unsplash.com/photo-1531427186611-ecfd6d936c79?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8NXx8aGVhZHNob3R8ZW58MHx8MHx8&auto=format&fit=crop&w=1200&q=60', 'I assist clients in their process of coming home to their body through somatic and mindfulness based psychotherapies. I use a multidisciplinary and personalized approach that looks at the roots of the disconnection to the body.', 140);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (15, 'Orran', 'Calken', 'ocalkene@washington.edu', 'Burnaby', 'BC', 'Japanese', 'Arabic', 'Counsellor', 'https://images.unsplash.com/photo-1573497019940-1c28c88b4f3e?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8OHx8aGVhZHNob3R8ZW58MHx8MHx8&auto=format&fit=crop&w=1200&q=60', 'I treat individuals struggling with low self esteem, depression, anxiety and life crises using ISTDP, a dynamic research based therapy model that creates deep and lasting change. It is quite amazing. For couples who are struggling with a lack of intimacy and communication difficulties, I use Emotionally Focused Therapy.', 114);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (16, 'Junina', 'Girdlestone', 'jgirdlestonef@netvibes.com', 'Vancouver', 'BC', 'Mandarin', 'Japanese', 'Clinical Social Worker', 'https://images.unsplash.com/photo-1573496358961-3c82861ab8f4?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MTB8fGhlYWRzaG90fGVufDB8fDB8fA%3D%3D&auto=format&fit=crop&w=1200&q=60', 'I value your experiences based on culture, race, indigeneity, socioeconomic status, gender identity, disability, age, sexuality, and spirituality. I often work with people who are of migrant, racialized, people of colour, queer, trans, Two-Spirit, non-binary, and intersex.', 88);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (17, 'Garrik', 'Ziehms', 'gziehmsg@netvibes.com', 'Vancouver', 'BC', 'Japanese', null, 'Psychiatrist', 'https://images.unsplash.com/photo-1629425733761-caae3b5f2e50?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MTF8fGhlYWRzaG90fGVufDB8fDB8fA%3D%3D&auto=format&fit=crop&w=1200&q=60', 'I prefer a holistic, humanistic, and existential approach to therapy. I have earned a Bachelor’s degree in psychology from UBC, and a Master of Counselling from City University of Seattle. I have over seven years of experience as a Mental Health Worker for various non-profit organizations and continue with ongoing training and workshops.', 59);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (18, 'Raimondo', 'Blincowe', 'rblincoweh@google.co.jp', 'Vancouver', 'BC', 'Swahili','Japanese', 'Counsellor', 'https://images.unsplash.com/photo-1573497161161-c3e73707e25c?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MTZ8fGhlYWRzaG90fGVufDB8fDB8fA%3D%3D&auto=format&fit=crop&w=1200&q=60', 'I am a certified Life Coach and Registered Professional Counsellor, specializing in loss and grief counselling and I am the founder of Village Grief Counselling here in Vancouver. I provide counselling for End of Life Transition, Life Transition Grief and Loss, Relationship Grief and Loss, Immigration Grief and Loss, and Grief and Loss Coaching.', 123);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (19, 'Ally', 'Pancoust', 'apancousti@xinhuanet.com', 'Vancouver', 'BC', 'Portuguese', 'Japanese', 'Counsellor', 'https://images.unsplash.com/photo-1508214751196-bcfd4ca60f91?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MjF8fGhlYWRzaG90fGVufDB8fDB8fA%3D%3D&auto=format&fit=crop&w=1200&q=60', 'Integer tincidunt ante vel ipsum. Praesent blandit lacinia erat. Vestibulum sed magna at nunc commodo placerat. Praesent blandit. Nam nulla. Integer pede justo, lacinia eget, tincidunt eget, tempus vel, pede. Morbi porttitor lorem id ligula. Suspendisse ornare consequat lectus. In est risus, auctor sed, tristique in, tempus sit amet, sem. Fusce consequat.', 105);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (20, 'Charlena', 'Skerritt', 'cskerrittj@biblegateway.com', 'Vancouver', 'BC', 'Tagalog', 'Japanese', 'Psychiatrist', 'https://images.unsplash.com/photo-1627161684458-a62da52b51c3?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MjR8fGhlYWRzaG90fGVufDB8fDB8fA%3D%3D&auto=format&fit=crop&w=1200&q=60', 'I am passionate about helping you pursue healing, growth, and self-understanding. My approach to counselling is rooted in the idea that the body holds knowledge that cannot always be expressed through words. I aim to offer you a supportive space to explore your story: past, present, and future. My wish is that you may find comfort in being witnessed, find home in your being, and find growth through exploration. ', 73);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (21, 'Harris', 'Whitworth', 'hwhitworthk@diigo.com', 'New Westminster', 'BC', 'Japanese', null, 'Clinical Social Worker', 'https://images.unsplash.com/photo-1642792735536-b6f7ef18b918?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MjV8fGhlYWRzaG90fGVufDB8fDB8fA%3D%3D&auto=format&fit=crop&w=1200&q=60', 'I firmly believe that change is possible through deeper knowledge of self and the integration of the body and mind. I aim to work alongside clients to help them gain safety and comfort in their bodies, their relationships, and their lives using emotion focused, narrative, mindfulness, and somatic techniques.', 125);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (22, 'Kirsteni', 'Bruniges', 'kbrunigesl@google.com.au', 'Vancouver', 'BC', 'Mandarin', 'Japanese', 'Psychologist', 'https://images.unsplash.com/photo-1543949806-2c9935e6aa78?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MjZ8fGhlYWRzaG90fGVufDB8fDB8fA%3D%3D&auto=format&fit=crop&w=1200&q=60', 'I am passionate about creating healing environments. Come and make conscious what is repressed psychologically and find inner harmony again. You deserve to feel hope again! INDIVIDUALS, COUPLES, FAMILIES welcome! Find relief from DEPRESSION, ANXIETY, ADDICTIONS, TRAUMA, RELATIONSHIP ISSUES, GRIEF.', 135);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (23, 'Merle', 'McMearty', 'mmcmeartym@bbc.co.uk', 'Vancouver', 'BC', 'Portuguese', 'Japanese', 'Clinical Social Worker', 'https://images.unsplash.com/photo-1562788869-4ed32648eb72?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MzB8fGhlYWRzaG90fGVufDB8fDB8fA%3D%3D&auto=format&fit=crop&w=1200&q=60', 'My expertise is in working with difficulties related to cultural, familial, and relational contexts. I specialize in depression, anxiety, anger issues, professional burnout, issues with sexuality, couples issues, family conflicts, self-harming, and more. In addition to having lived in Hong Kong, I have worked diverse clients in Los Angeles and Vancouver. People who are seeking to make sense of themselves tend to find me very helpful.', 65);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (24, 'Doreen', 'Peagrim', 'dpeagrimn@godaddy.com', 'Vancouver', 'BC', 'Spanish', 'Japanese', 'Counsellor', 'https://images.unsplash.com/photo-1579420593648-0deba81fd762?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MjB8fGhlYWRzaG90JTIwYXNpYW58ZW58MHx8MHx8&auto=format&fit=crop&w=1200&q=60', 'I provide counselling, psychotherapy and supervision services. My practice is guided by extensive experience working with people coming from various socioeconomic backgrounds as well as many years of serving the most vulnerable communities in Vancouver’s DTES. While my approach is integrative of modern theories and techniques, it heavily relies on Psychodynamic theories and practice.', 108);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (25, 'Cos', 'Throughton', 'cthroughtono@sciencedaily.com', 'Richmond', 'BC', 'Japanese', 'Punjabi', 'Clinical Social Worker', 'https://images.unsplash.com/photo-1638493489135-34bf34dd320b?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8Mzd8fGhlYWRzaG90fGVufDB8fDB8fA%3D%3D&auto=format&fit=crop&w=1200&q=60', 'Do you feel anxious or depressed or hopeless? Have you experienced a loss? Do you experience feelings of panic? Are you struggling with a lack of direction or purpose? I work with adults experiencing grief, anxiety, depression, and relationship issues. I have a decade of healthcare experience working with individuals and families experiencing traumatic grief, and loss.', 65);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (26, 'Colas', 'Cansfield', 'ccansfieldp@zimbio.com', 'Richmond', 'BC', 'Italian', 'Japanese', 'Counsellor', 'https://images.unsplash.com/photo-1614644147724-2d4785d69962?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8NDV8fGhlYWRzaG90fGVufDB8fDB8fA%3D%3D&auto=format&fit=crop&w=1200&q=60', 'My overarching approach is Adlerian (positive, encouraging, and holistic). We may incorporate into our sessions any number of approaches including mindfulness-based modalities, narrative approaches, cognitive behavioural approaches, Internal Family Systems, etc. Working together means that you experience a non-judgemental space for your story to unfold.', 57);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (27, 'Dore', 'Goodhand', 'dgoodhandq@hud.gov', 'Richmond', 'BC', 'Tagalog', 'Japanese', 'Psychiatrist', 'https://images.unsplash.com/photo-1529232356377-57971f020a94?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8NTR8fGhlYWRzaG90fGVufDB8fDB8fA%3D%3D&auto=format&fit=crop&w=1200&q=60', 'Stuck in your relationship? Feeling misunderstood, blamed, or attacked? Arguments and conflict weighing you down? Feeling empty or disconnected, frightened to speak your needs? If you are struggling in your relationships repeating the same pattern and in need of a way forward contact me today for your FREE 15 minute consultation.', 66);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (28, 'Kally', 'Snelman', 'ksnelmanr@blogs.com', 'Richmond', 'BC', 'Tagalog', 'Japanese', 'Counsellor', 'https://images.unsplash.com/photo-1631885628726-d60689c330db?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8Njd8fGhlYWRzaG90fGVufDB8fDB8fA%3D%3D&auto=format&fit=crop&w=1200&q=60', 'I am a Registered Clinical Counsellor and member of the BCACC. I hold a Master degree in Counselling Psychology from Adler University. I adopt a variety of perspectives ranging from Mindfulness and Somatic, Cognitive, Emotionally Focused (EFT), to Trauma based interventions (Observed & Experiential Integration).', 133);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (29, 'Tabby', 'Hanford', 'thanfords@uol.com.br', 'Vancouver', 'BC', 'German', 'Japanese', 'Clinical Social Worker', 'https://images.unsplash.com/photo-1609436132311-e4b0c9370469?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8Njl8fGhlYWRzaG90fGVufDB8fDB8fA%3D%3D&auto=format&fit=crop&w=1200&q=60', ' I specialize in relationship issues and have received training in the Gottman Method (Level 1 and 2). Relationship counselling can occur individually or with a partner. I have also received training in EMDR.', null);
insert into professionals (id, first_name, last_name, email, city, province, language_1, language_2, profession, icon_url, description, cost_per_session) values (30, 'Teddie', 'Speight', 'tspeightt@ft.com', 'Vancouver', 'BC', 'Japanese', null, 'Psychologist', 'https://images.unsplash.com/photo-1607569708758-0270aa4651bd?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8NzN8fGhlYWRzaG90fGVufDB8fDB8fA%3D%3D&auto=format&fit=crop&w=1200&q=60', 'My expertise in the field of Somatic Psychology, Expressive Arts Therapy, Continuum Movement and progressive modalities, such as Sensorimotor Psychotherapy (Trauma Training) and Yoga Therapy, further equips me in designing therapy plans unique to each client . I have 20 years experience in the field and a very high success rate.', 141);
